INSERT INTO `v1_3dad756788cd4181ef3e4fbd9df95b2a17ef333b72abc1cd82c9b05499c297a7` VALUES (1905, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", "ダメージ減衰", 92425340, 18);
INSERT INTO `v1_3dad756788cd4181ef3e4fbd9df95b2a17ef333b72abc1cd82c9b05499c297a7` VALUES (1906, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", "ＴＰ上昇上限付与", 92425340, 17);
INSERT INTO `v1_3dad756788cd4181ef3e4fbd9df95b2a17ef333b72abc1cd82c9b05499c297a7` VALUES (1907, "バトル開始時、すべてのキャラのＨＰ吸収を中ダウンさせる。", "ＨＰ吸収ダウン", 92425340, 9);
INSERT INTO `v1_3dad756788cd4181ef3e4fbd9df95b2a17ef333b72abc1cd82c9b05499c297a7` VALUES (1908, "バトル開始時、すべてのモンスターがダメージ\n30％カット状態になる。", "ダメージカット", 92425340, "boss_damage_cut");
